import { useState } from "react";
import { useSearchParams } from 'react-router-dom';
import './pass.css';

const PassShow = () => {
    const [qr, setQr] = useState("");
    const [bgUrl, setBG] = useState("");
  const [searchParams] = useSearchParams();
    console.log();
    setQr(searchParams.get('qrData'));
    setBG(searchParams.get('bgurl'));
  return (
    <div className="bg-img-pass" style={{background: `url(${bgUrl})`}}>
            <div className="container-pass">
              <img src={qr} alt="gamer-img" width="100%" height="100%"/>
            </div>
          </div>
  );
};

export default PassShow;
